import { Box, Button, TextField, Typography } from "@mui/material";
import React from "react";
import { lightBlue } from "@mui/material/colors";

const Auth = () => {
  const color = lightBlue[500];
  return (
    <form>
      <Box
        display="flex"
        flexDirection={"column"}
        alignItems="center"
        justifyContent={"center"}
        boxShadow="10px 10px 20px #ccc"
        padding={3}
        margin="auto"
        marginTop={5}
        borderRadius={5}
        maxWidth={400}
      >
        <Typography
          padding={3}
          textAlign="center"
          variant="h4"
          fontWeight={600}
        >
          Login
        </Typography>
        <TextField variant="outlined" label="Email" margin="normal" />
        <TextField variant="outlined" label="Password" margin="normal" />
        <TextField variant="outlined" label="Name" margin="normal" />
        <Button
          sx={{ borderRadius: 3, marginTop: 2 }}
          color="warning"
          variant="contained"
        >
          Sumbit
        </Button>
        <Button
          sx={{ borderRadius: 3, marginTop: 2, color: color }}
          variant="contained"
          text
        >
          Change to signup
        </Button>
      </Box>
    </form>
  );
};

export default Auth;
